/* harmony default export */ __webpack_exports__["default"] = ("<div id=\"hk-about\">\n  <!-- Intro -->\n  <div class=\"about-desc\">\n    <h3>Hi! I'm Hyung-Kwon.</h3>\n    <p>I am a Master's student in the Computer Science and Engineering dept. at Seoul National University, Seoul, Korea, \n      working with <a href=\"http://hcil.snu.ac.kr/people/jinwook-seo\">Prof. Jinwook Seo</a> and \n      the <a href=\"http://hcil.snu.ac.kr\">Human-Computer Interaction Laboratory</a>. \n      Before joining this laboratory, I received my Bachelor's degree in Mathematics \n      with a minor in Industrial Engineering from Hanyang University, Seoul, Korea in 2019. \n      My life-long goal is to understand and control the latent space in both efficient and effective ways \n      with a firm background of mathematical knowledge. \n      My field of interest covers information visualization, HCI.\n    </p>\n    <!-- <img src=\"../../assets/images/hkko.jpg\" class=\"about-center-img\"> -->\n    <img src=\"./assets/images/hkko.jpg\" class=\"about-center-img\">\n    <div class=\"about-desc-mid\">\n      <p>March 2015 at Columbia University,<br>New York, NY, USA</p>\n    </div>\n  </div>\n\n  <!-- Work Experience -->\n  <div class=\"hk-about-wrap\">\n    <div class=\"hk-about-wrap-inner1\">\n      <!-- <h3>Work Experience</h3> -->\n      <h3><b>Work Experience</b></h3>\n    </div>\n    <div class=\"hk-about-wrap-inner2\">\n      <h5><b>Intern / LG Electronics</b></h5>\n      <h6 class=\"hk-text-grey\">Research & Development center / Home electronics company</h6>\n      <h6 class=\"hk-text-fix\">\n        <div class=\"hk-about-li\">\n          <li><i class=\"fa fa-calendar\"></i>Jan 2019 - Feb 2019</li>\n          <li><i class=\"fa fa-map-marker\"></i>Seoul, Korea</li>\n        </div>\n      </h6>\n      <ul>\n        <li>Worked on data mining project in customer relationship management(CRM) for sales promotion</li>\n      </ul>\n    </div>\n    <div class=\"hk-about-wrap-inner2\">\n      <h5><b>Research Associate / Wesleyquest Inc.</b></h5>\n      <h6 class=\"hk-text-grey\">Strategic consulting\f firm</h6>\n      <h6 class=\"hk-text-fix\">\n        <div class=\"hk-about-li\">\n          <li><i class=\"fa fa-calendar\"></i>Jun 2018 - Sep 2018</li>\n          <li><i class=\"fa fa-map-marker\"></i>Seoul, Korea</li>\n        </div>\n      </h6>\n      <ul>\n        <li>Participated in two big data projects described below. Made deep-learning based prediction model using Keras</li>\n        <li>Improved the air quality management system in Seoul Metro (client: Seoul Digital Foundation)</li>\n        <li>Invented the model of predicting the workers compensation using big data (Client: Korea Workers Compensation and Welfare Service)</li>\n      </ul>\n    </div>\n  </div>\n\n  <!-- EDUCATION -->\n  <div class=\"hk-about-wrap\">\n    <div class=\"hk-about-wrap-inner1\">\n      <h3><b>Education</b></h3>\n    </div>\n    <div class=\"hk-about-wrap-inner2\">\n      <h5><b>Master of Science in Computer Science and Engineering</b></h5>\n      <h6 class=\"hk-text-grey\">Human-Computer Interaction Lab at Seoul National University</h6>\n      <h6 class=\"hk-text-fix\">\n        <div class=\"hk-about-li\">\n          <li><i class=\"fa fa-calendar\"></i>Sep 2019 - <span class=\"hk-tag hk-fix hk-round\">Current</span></li>\n          <li><i class=\"fa fa-map-marker\"></i>Seoul, Korea</li>\n        </div>\n      </h6>\n      <ul>\n        <li>Advisor: Prof. Jinwook Seo, Ph.D.</li>\n        <li>Field of study: Information Visualization, Human-Computer Interaction</li>\n      </ul>\n    </div>\n    <div class=\"hk-about-wrap-inner2\">\n      <h5><b>Bachelor of Science in Mathematics</b></h5>\n      <h6 class=\"hk-text-grey\">Hanyang University</h6>\n      <h6 class=\"hk-text-fix\">\n        <div class=\"hk-about-li\">\n          <li><i class=\"fa fa-calendar\"></i>Mar 2014 - Aug 2019</li>\n          <li><i class=\"fa fa-map-marker\"></i>Seoul, Korea</li>\n        </div>\n      </h6>\n      <ul>\n        <li>Minor in Industrial Engineering</li>\n        <li>Took additional 22 credits of Computer Science courses</li>\n      </ul>\n    </div>\n  </div>\n\n  <!-- AWARDS -->\n  <div class=\"hk-about-wrap\">\n    <div class=\"hk-about-wrap-inner1\">\n      <h3><b>Awards</b></h3>\n    </div>\n    <div class=\"hk-about-wrap-inner2\">\n      <h5><b>3rd place in Big Contest</b></h5>\n      <h6 class=\"hk-text-grey\">Open contest held by National Information Society Agency / Korea Bigdata Forum</h6>\n      <h6 class=\"hk-text-fix\">\n        <div class=\"hk-about-li\">\n          <li><i class=\"fa fa-calendar\"></i>Aug 2018 - Oct 2018</li>\n        </div>\n      </h6>\n      <ul>\n        <li>Developed \"Financial Information Index for Individual User\" with Shinhan Bank data</li>\n      </ul>\n    </div>\n    <div class=\"hk-about-wrap-inner2\">\n      <h5><b>2nd Place in Artificial Intelligence Novel Competition</b></h5>\n      <h6 class=\"hk-text-grey\">Open contest held by KT and KOCCA</h6>\n      <h6 class=\"hk-text-fix\">\n        <div class=\"hk-about-li\">\n          <li><i class=\"fa fa-calendar\"></i>Mar 2018 - Aug 2018</li>\n        </div>\n      </h6>\n      <ul>\n        <li>Made deep learning-based Korean sentence recommender which uses BiLSTM and Doc2Vec algorithm</li> \n        <li>Received an opportunity to participate in KT's next project and 20,000,000 KRW of prize money</li>\n      </ul>\n    </div>\n    <div class=\"hk-about-wrap-inner2\">\n      <h5><b>2nd Place in Academical team research</b></h5>\n      <h6 class=\"hk-text-grey\">Natural Science College of Hanyang University</h6>\n      <h6 class=\"hk-text-fix\">\n        <div class=\"hk-about-li\">\n          <li><i class=\"fa fa-calendar\"></i>Mar 2017 - Nov 2017</li>\n        </div>\n      </h6>\n      <ul>\n        <li>Predicted the number of visitors of children's grand park with regression, SVR and time series model</li> \n      </ul>\n    </div>\n  </div>\n\n  <!-- Programming Skills -->\n  <div class=\"hk-about-wrap\">\n    <div class=\"hk-about-wrap-inner1\">\n      <h3><b>Programming Skills</b></h3>\n    </div>\n    <div class=\"hk-about-wrap-inner2\">\n      <h6 class=\"hk-text-grey\">Languages: Python(Tensorflow, Keras), R, C/C++, Javascript(Angular), Matlab, SQL</h6>\n      <h6 class=\"hk-text-grey\">Technologies: git, vim, AWS EC2, Latex</h6>\n    </div>\n  </div>\n\n  <!-- Volunteer Experience -->\n  <div class=\"hk-about-wrap\">\n    <div class=\"hk-about-wrap-inner1\">\n      <h3><b>Volunteer Experience</b></h3>\n    </div>\n    <div class=\"hk-about-wrap-inner2\">\n      <h5><b>Intern / The Actors Theatre Workshop</b></h5>\n      <h6 class=\"hk-text-grey\">Nonprofit organization</h6>\n      <h6 class=\"hk-text-fix\">\n        <div class=\"hk-about-li\">\n          <li><i class=\"fa fa-calendar\"></i>Mar 2016 - Aug 2016</li>\n          <li><i class=\"fa fa-map-marker\"></i>New York, NY, USA</li>\n        </div>\n      </h6>\n      <ul>\n        <li>Participated in a social project(Builders of the New World) as a main staff</li>\n        <li>Managed human resources, crowdfunding tasks and donations for the program</li>\n      </ul>\n    </div>\n  </div>\n\n  <!-- Military Service -->\n  <div class=\"hk-about-wrap\">\n    <div class=\"hk-about-wrap-inner1\">\n      <h3><b>Military Service</b></h3>\n    </div>\n    <div class=\"hk-about-wrap-inner2\">\n      <h5><b>Administrative Clerk / 11th Division</b></h5>\n      <h6 class=\"hk-text-grey\">Republic of Korea Army</h6>\n      <h6 class=\"hk-text-fix\">\n        <div class=\"hk-about-li\">\n          <li><i class=\"fa fa-calendar\"></i>Jun 2011 - Mar 2013</li>\n          <li><i class=\"fa fa-map-marker\"></i>Gangwon-do, Korea</li>\n        </div>\n      </h6>\n      <ul>\n        <li>Transferred from active service to\f first reserve</li>\n      </ul>\n    </div>\n  </div>\n</div>");

